description:
Bán toà nhà tổ hợp Văn phòng - Nhà ở Xuân Đỉnh, Bắc Từ Liêm.
* Mô tả.
- Diện tích: 150m², xây dựng 7 tầng, có thang máy.
- Mặt tiền: 7.6m.
- Thiết kế hiện tại như sau:
+ T1: Phòng khách, kho, vệ sinh, phòng nhỏ phía sau;
+ T2: Thông sàn;
+ T3: 1 ngủ nhỏ, 1 vệ sinh ngoài, 2 ngủ lớn + vệ sinh trong;
+ T4: 1 ngủ lớn + vệ sinh trong, 1 ngủ lớn + 1 ngủ nhỏ + vệ sinh ngoài Khe thoáng từ tầng 4 khoảng 3m²;
+ T5: 1 ngủ lớn, 1 phòng làm việc, sân chơi;
+ T6: 2 ngủ lớn;
+ T7: Phòng thờ, sân phơi.
- Nội thất: Cơ bản. Khách mua về Setup mới theo nhu cầu sử dụng thực tế hoặc nhờ bên mình tư vấn thiết kế - thi công.
* Đặc điểm - Nhà xây chắc chắn, đa năng. Kết hợp được vừa ở, vừa làm văn phòng hoặc cơ sở kinh doanh;
- Nằm trên đoạn đẹp nhất của ngõ, thông sang Phạm Văn Đồng. Có tiềm năng về quy hoạch, sau khi quy hoạch mở đường mới sẽ nằm trên trục đường 18.5m có vỉa hè từ Phạm Văn Đồng ra thẳng công viên.
- Mặt cắt đường trước nhà lớn, ô tô tránh nhau thoải mái.
* Giá chào bán: 23.5 tỉ đồng.
